I tried to use the following code:
var list = ["a", "A", "b", "B", "c", "C"];
list.sort(function(a, b) {
    return a.toLowerCase() > b.toLowerCase();
console.log(list);
But the result is: ["A", "a", "B", "b", "C", "c"].
How can I sort the list in case-sensative way?
You need to return a - b instead of a > b . –  Felix Kling May 14 '13 at 12:54
You need to return a - b instead of a > b . The latter will return true if a is greater than b , which is not what you want. You want to return the difference between the two strings, which will be negative if a is less than b , positive if a is greater than b , and zero if they are equal.
list.sort(function(a, b) {
    return a.toLowerCase().localeCompare(b.toLowerCase());
